Para los amantes de la #Pasta hoy te dejamos esta deliciosa receta para que la disfrutes y cuando la prepares  nos cuentes qué tal te quedó 😋

Pasta con salsa Alfredo
𝙄𝙣𝙜𝙧𝙚𝙙𝙞𝙚𝙣𝙩𝙚𝙨:⁣
🔻1/2 kg de pasta Horizonte o Allegri 
🔻3 cucharadas de Mantequilla Los Andes
🔻2 cucharadas de aceite de oliva
🔻2 dientes de ajo picados
🔻2 tazas de Crema de Leche Los Andes
🔻1/2 cucharadita de pimienta
🔻1/2 taza de queso parmesano
🔻3/4 taza de queso mozzarella
🔻100 gramos de tocineta (opcional).

𝙋𝙧𝙚𝙥𝙖𝙧𝙖𝙘𝙞𝙤́𝙣:
1️⃣ Poner en el fuego abundante agua una olla grande. Una vez que esté hirviendo, agregar la pasta y cocinarla por 7 minutos.
2️⃣ Mientras tanto, sofreir la tocineta y el ajo en un sartén a fuego bajo.
3️⃣ Agregar al sartén la mantequilla, la crema de leche, el queso parmesado, la pimienta y cocinar por 8 minutos, mezclando constantemente.
4️⃣ Por último agregar el queso mozzarella y mezclar constantemente hasta que se derrita y se junte con el resto de los ingredientes.
5️⃣ Servir y disfrutar.

